import { APIService } from '@ohrm/core/util/services/api.service';
export default {
  name: 'EventAutocomplete',
  setup() {
    const http = new APIService(window.appGlobal.baseUrl, '/api/v2/claim/events');
    return {
      http
    };
  },
  methods: {
    async loadEvents(serachParam) {
      return new Promise(resolve => {
        if (serachParam.trim()) {
          const params = {
            name: serachParam.trim()
          };
          this.http.getAll(params).then(({
            data
          }) => {
            resolve(data.data.map(event => {
              return {
                id: event.id,
                label: event.name
              };
            }));
          });
        } else {
          resolve([]);
        }
      });
    }
  }
};
